package cn.iocoder.algorithm.leetcode.no0680;

/**
 * https://leetcode-cn.com/problems/valid-palindrome-ii/
 *
 * 实际上，这道题目，还可以继续增强。例如说，允许删除 N 个字符。胖友，你会这么思考呢？
 */
public class Solution {

    public boolean validPalindrome(String s) {
        assert s != null && s.length() > 0;

        return validPalindrome(s, 0, s.length() - 1, false);
    }

    public boolean validPalindrome(String s, int left, int right, boolean delete) {
        while (left < right) {
            // 进行比较
            if (s.charAt(left) != s.charAt(right)) {
                return !delete
                        && (validPalindrome(s, left + 1, right, true)
                            || validPalindrome(s, left, right - 1, true));
            }
            left++;
            right--;
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
//        System.out.println(solution.validPalindrome(""));
//        System.out.println(solution.validPalindrome("abca"));
        System.out.println(solution.validPalindrome("cbbcc"));
    }

}
